import React, {Component, useState}  from 'react';
import { Route, Redirect, Switch, Router } from 'react-router-dom';
import { withRouter } from "react-router";





const Protected = (props) =>{
     const Home = props.component
     const isUser =   JSON.parse( localStorage.getItem( "auth") )

     return(
        <>
        <Route exact path="/" render={()=>(
  isUser? <Redirect to="/home" /> : <Home state={Home} />         
)} />
            {/* { isUser ? <Redirect  to="/home" /> : <Redirect  to= "/"/> } */}
                
        {isUser ? <h1>HEllo</h1>: null}
    
         
      
        
        </>
     )

}




export default withRouter(Protected) ;
